import React from 'react'

import {Form} from "semantic-ui-react"

export default function Question({sno,question,answer,details,handleFormFill}) {
    return (
        <div>
            <h4> {sno}. {question}</h4>

            <Form.Group widths="equal">
            <Form.Field label="Whether Govt. accomodation alloted in Jammu/Srinagar" />
          </Form.Group>
          <Form.Group>
            <Form.Field width={4}>
              <Radio
                label="Yes Alloted"
                name="accomodationGroup"
                value="alloted"
                checked={form["govt_accomodation_alloted"] === "alloted"}
                onChange={() => {
                  handleFormFill(
                    "employee_office_details",
                    "govt_accomodation_alloted",
                    "alloted"
                  );
                }}
              />
            </Form.Field>
            <Form.Field width={4}>
              <Radio
                label="Not Alloted"
                name="accomodationGroup"
                value="not_alloted"
                checked={form["govt_accomodation_alloted"] === "not_alloted"}
                onChange={() => {
                  handleFormFill(
                    "employee_office_details",
                    "govt_accomodation_alloted",
                    "not_alloted"
                  );
                }}
              />
            </Form.Field>
          </Form.Group>
        </div>
    )
}
